  \ as \"SRepQuarter\",\n          \"SRepEmployeeNumber\" as \"SRepEmployeeNumber\"\
  ,\n          \"SRepTerrSysId\" as \"SRepTerrSysId\",\n          \"EmpSysID\" as\
