  \ \"SRepQuotaComponent\" as \"SRepQuotaComponent\"\n   FROM \"EDW_LS\".\"SALES_EM\"\
  .\"ST_TBLREPQUOTA\"\n   WHERE \"SRepQuotaComponent\"='random')Projection_1;"
